import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    margin-top: 40px;

    background-color: #f605;
    width:100%;
    padding:0 100px;
    height:60px;
    display: flex;
    justify-content: center;
    align-items: center;

    .nav{
      background-color: #00f5;
      display: flex;
      margin:0 auto;
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <nav className='nav'>
        <div className='navInner'>
          <img className='logoImg' alt='logoImg' src='img/logo.png'/>
        </div>
      </nav>
    </HeaderContainer>
  );
});

export default Header;
